import Vue from 'vue'
import App from './App.vue'
import './assets/styles/index.css'
import './assets/zititubiao/css/all.css'
//引入ui插件
// import ElementUI from 'element-ui'
// import 'element-ui/lib/theme-chalk/index.css'
Vue.config.productionTip = false
// Vue.use(ElementUI)
new Vue({
  render: h => h(App),
}).$mount('#app')
